CREATE TABLE bolide(id_bolide INT PRIMARY KEY,Vitesse_kms VARCHAR(10),énergie_totale_rayonnée_J VARCHAR(10),id_phenomene INT,id_localisation INT,id_date INT, FOREIGN KEY (id_phenomene) REFERENCES phenomenes(id_phénomene), FOREIGN KEY (id_localisation) REFERENCES localisation(id_local), FOREIGN KEY (id_date) REFERENCES date(id_date));
